import React from 'react';
import { createGlobalStyle } from 'styled-components';
import Header from './Header';

const GlobalStyles = createGlobalStyle`
    html {
        --red: #ff0000;
        --black: #393939;
        --grey: #3A3A3A;
        --lightGrey: #e1e1e1;
        --offWhite: #ededed;
        --maxWidth: 1000px;
        --bs: 0 12px 24px 0 rgba(0,0,0,0,.09);
    }
`;

const Page = ({ children }) => (
  <div>
    <Header />
    <h1>How are you??</h1>
    {children}
  </div>
);

export default Page;
